// Dependencies.
import React from 'react';

// Component 'AboutMe'.
function AboutMe() {
    return (
        // AboutMe Container.
        <>
            <div id="AboutMe">
                <div className="container-fluid text-center">
                    {/* My Profile Picture */}
                    <img id="iamshawn-profile2" className="img-thumbnail" alt="iamshawn2.jpg" src="../../assets/misc/iamshawn2.jpg" />
                    {/* Dive Deep Label */}
                    <h1 id="DiveDeepLabel" className="display-4 text-white">Dive Deeper!</h1>
                    {/* Dive Deep ('About Me' Link) */}
                    <a href="#AboutMe" className="btn btn-info hvr-icon-down">
                        About Me <i className="fas fa-angle-double-down hvr-icon"></i>
                    </a>
                </div>
            </div>
        </>
    );
}

// Do export.
export default AboutMe;
